const Card = ({mov}) => {
    console.log(movie);
    return (
      <div className="card">
        <div className="card-image">
          <figure className="image">
            <img
              src={mov.poster_path}
              alt="Placeholder image"
            />
          </figure>
        </div>
        <div className="card-content">
          <div className="media">
            <div className="media-left">
              <div className="media-content">
                <p className="title is-6">{mov.title}</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  };

  export default Card;
